INSERT INTO `question_difficult` (`question_difficult_id`, `question_difficult_description`) VALUES (4, 'Padrão');
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (1, 'Francisco, que é brasileiro e possui os requisitos de idoneidade moral, reputação ilibada e vasta experiência na administração pública, foi designado pelo Presidente da República para mandato de três anos, podendo ser reconduzido uma única vez, para integrar o Conselho de Ética Pública (CEP). Agiu corretamente a Administração Pública conforme preceitua o Decreto n. 6029/2007.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (2, 'Com base na ética no serviço público, julgue: o servidor público deve atender as pessoas de forma a evitar a formação de longas filas ou qualquer outra espécie de atraso na prestação do serviço, evitando, desta forma, apenas atitudes contra a ética ou ato de desumanidade.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (3, 'Fernanda, advogada atuante na área da previdência social, comparece todos os dias na mesma agência para resolver processos administrativos de seus clientes. Joaquim, servidor lotado na mesma agência, recebe de Fernanda, paulatinamente, presentes para compensar pelo seu bom desempenho na função. Com base no Decreto 1.171/94 o servidor público agiu corretamente em aceitar os presentes, pois a cortesia, a boa vontade, o cuidado e o tempo dedicados ao serviço público caracterizam o esforço pela disciplina.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (4, 'Segundo a Lei 8.112/90, Remuneração é o vencimento do cargo efetivo, acrescido das vantagens pecuniárias permanentes estabelecidas em lei. As vantagens são formadas pelas indenizações, que não se incorporam ao vencimento ou provento para qualquer efeito, gratificações e adicionais, os quais se incorporam aos vencimentos ou proventos, nos casos e condições indicados em lei.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (5, 'Francisco, servidor público federal, está sofrendo processo administrativo disciplinar, já na fase do inquérito administrativo, o servidor foi citado para apresentar defesa escrita no prazo de 10 dias. Diante disso, Francisco compareceu na repartição onde encontra-se o processo e requereu a sua retirada para melhor análise da acusação, contudo, este direito lhe foi negado, pois, segundo o que prescreve a lei 8.112/90, a vista do processo deverá ocorrer na repartição, agindo corretamente a Administração Pública.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (6, 'A esposa do técnico do INSS foi eleita vereadora em Município diverso e distante daquele que o servidor exerce sua função. Conforme o regime jurídico único, o servidor poderá requerer licença por motivo de afastamento do cônjuge, contudo deverá fazer por tempo determinado e sem direito a remuneração.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (7, 'Servidor público que tomou posse e deixou de entrar em exercício será demitido por abandono de emprego, devendo, entretanto, sofrer o devido processo administrativo, garantindo-lhe o contraditório e a ampla defesa.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (8, 'O Regime Jurídico Único determina ao servidor público o seu afastamento do cargo no caso de exercício de mandado eletivo, salvo no caso de vereador em que há compatibilidade de horários', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (9, 'Maria, servidora pública, trabalha em contato permanente com substâncias radioativas, diante disso, ela recebe um adicional sobre o vencimento do cargo efetivo. Após 2 anos, Maria deixou de ter contato com qualquer agente nocivo. Por esta razão, a Administração Pública cancelou o adicional, a servidora, por sua vez, demandou administrativamente requerendo a manutenção do valor, por entender que este incorporou aos seus vencimentos. Maria agiu em acordo com o que prescreve a Lei 8.112/90.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (10, 'Com base na lei 8.112/90, julgue: O servidor público poderá se afastar, sem qualquer prejuízo: por 1 dia para doação de sangue; 5 dias em caso de falecimento do cônjuge, companheiro, pais, madrasta ou padrasto, filhos, enteados, menor sob guarda ou tutela e irmãos; e de 8 dias no caso de casamento.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (11, 'Entre os direitos sociais elencados pela Constituição Federal encontram-se a educação, a previdência social, o lazer e a assistência aos desamparados.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (12, 'O bombeiro poderá criar Associação, pois a constituição brasileira garante a plena liberdade de associação para fins lícitos, contudo ele não poderá criar com fins paramilitar, visto que neste caso é expressamente vedado pela constituição.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (13, 'Com base no art. 5º da Constituição Federal, julgue: João deseja manifestar-se sobre o aumento da passagem de ônibus em sua cidade, contudo pretende fazer de forma anônima já que a Constituição Federal afirma que é livre a expressão da atividade intelectual, artística, científica e de comunicação, independentemente de censura ou licença.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (14, 'Habeas Data é um remédio constitucional utilizado no caso de ausência de norma regulamentadora, o que torna inviável o exercício dos direitos e liberdades constitucionais, exemplo mais conhecido é o direito de greve dos servidores públicos.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (15, 'A Constituição Federal proíbe qualquer diferença de salários, de exercício de funções e de critério de admissão por motivo de sexo, idade, cor ou estado civil; entretanto, permite a discriminação no tocante a salário e critérios de admissão do trabalhador portador de deficiência, pois trata-se do princípio da igualdade, ofertando aos portadores de deficiência a inclusão no mercado de trabalho.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (16, 'Joana é brasileira naturalizada, a qual foi adquirida por meio da naturalização extraordinária que tem como requisito 15 anos de permanência no Brasil e ausência de condenação penal. Com a naturalização, Joana pretende se candidatar a senadora, o que lhe é assegurado pela Constituição Federal', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (17, 'Pedro, brasileiro nato, possui 25 anos e reside em Salvador, pretende se candidatar para Governador do Estado da Bahia, o que é perfeitamente possível já que ele possui todos os requisitos para a elegibilidade: alistamento eleitoral, nacionalidade brasileira, domicílio eleitoral e idade mínima.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (18, 'A função de confiança destina-se exclusivamente aos servidores de carreira, devendo ser concursado e podendo está no estágio probatório, enquanto que o cargo em comissão pode ser para os servidores de carreira ou para aqueles que não prestaram concurso público, neste caso será de livre nomeação e exoneração.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (19, 'Quando um governante utiliza de obras públicas para se autopromover fere o princípio constitucional administrativo da publicidade, isso porque a divulgação dos feitos da Administração Pública deve seguir um determinado rito estipulado por lei.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (20, 'A empresa pública faz parte da administração pública indireta e tem o capital 100% público, sendo este um dos seus principais requisitos. Além disso, a personalidade jurídica é de direito privado, podendo prestar serviço público ou explorar atividade econômica, como é o caso dos Correios e da Caixa Econômica Federal, respectivamente.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (21, 'Os Órgãos Públicos não têm personalidade jurídica própria, conforme Celso Antônio Bandeira de Mello “os órgãos nada mais significam que círculos de atribuições, os feixes individuais de poderes funcionais repartidos no interior da personalidade estatal e expressados através dos agentes neles providos.”', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (22, 'São poderes da administração pública: o poder vinculado e o discricionário. O poder vinculado é aquele em que o Administrador não possui margem para o juízo de conveniência e oportunidade, o que já ocorre no poder discricionário, tanto que neste caso o Administrador poderá revogar a sua decisão, tendo como norte o princípio do interesse público.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (23, 'Quando o servidor é punido administrativamente, após o devido processo, utiliza-se como instrumento para atuação da Administração Público o poder hierarquico.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (24, 'Para a validade do ato administrativo são necessários os seguintes elementos: competência, motivo, forma, finalidade e objeto. Nos atos discricionários apenas a forma e objeto são passíveis de análise quanto à conveniência e a oportunidade, enquanto que a competência, motivo e finalidade serão sempre vinculados.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (25, 'A Administração Pública, diferente do particular, possui alguns atributos específicos na sua atuação. Quando determinado servidor da Companhia de Transito está aplicando uma multa, ele está utilizando o atributo da exigibilidade dos atos da Administração Pública, tendo em vista tratar-se de meio indireto de coercibilidade.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (26, 'Determinado Comerciante, após cumprir todas as legalidades formais para a abertura de seu estabelecimento, deixou de cumprir com seus deveres em relação à higiene do lugar, por esta razão a Administração Pública anulou o seu alvará de funcionamento, por possuir competência para a extinção do ato administrativo.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (27, 'Prefeito, de uma pequena cidade do anterior, deseja realizar uma delegação de serviço público, para tanto questionou o departamento jurídico do Município se poderia ser feita por meio de concessão ou se estava atrelado à permissão, pois o edital deve permitir a participação de Pessoas Físicas e Jurídicas. O corpo jurídico respondeu que neste caso a delegação deve ser feita por meio de permissão, podendo o edital ser feito em qualquer modalidade, respeitando a legislação vigente.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (28, 'O agente público que cometer improbidade administrativa, enriquecendo-se de forma ilícita, poderá sofrer a sanção de suspensão dos direitos políticos de 8 a 10 anos e a proibição de contratar com a administração pública por até 8 anos, além do ressarcimento integral do dano.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (29, 'O ato de improbidade administrativa não está, obrigatoriamente, relacionado com o dano causado ao erário, isso porque o simples fato de o Agente violar os princípios da Administração Pública já comete improbidade, se a conduta estiver elencado nos incisos do art. 11 da Lei 8.429/92.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (30, 'Com base na lei 9.784/99, que trata sobre o processo administrativo, julgue: A Autoridade que proferiu a decisão no processo administrativo, assim que receber o recurso da parte, poderá reconsiderar a sua decisão no prazo de 5 dias, caso não o faça, deverá remeter o processo a autoridade superiora para o julgamento do recurso.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (31, 'O Instituto Nacional do Seguro Social foi criado pela lei 8.029, em 1990 como autarquia federal, tendo como escopo cuidar dos benefícios e custeios da seguridade social. Hoje, contudo, apenas os benefícios são de responsabilidade do INSS, enquanto que o custeio é de competência da Secretaria da Receita Federal do Brasil.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (32, 'Os serviços são prestações não pecuniárias disponíveis pela Previdência Social para os segurados e os dependentes e compreende a reabilitação profissional, pecúlios e serviço social.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (33, 'A empresa que deixar de cumprir as normas de segurança e higiene do trabalho pode cometer contravenção penal punível com multa.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (34, 'Maria possui uma doença degenarativa e para a legislação previdenciária ela não é considerada como doença do trabalho, pois não trata-se de uma doença profissional ou uma doença do trabalho.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (35, 'Com base nos princípios constitucionais da seguridade social, julgue: O princípio da universalidade da cobertura tem como objetivo selecionar para melhor distribuir, isso porque somente após verificar todas as pessoas que serão cobertas pelos benefícios é que então será realizada a sua distribuição.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (36, 'Ainda com base nos princípios constitucionais da seguridade social, julgue: o princípio da diversidade da base de custeio serve para tornar mais eficiente a manutenção da seguridade social, pois há diversas fontes de receita, entre elas tem-se a cobrança de contribuição sobre apostas em concursos de prognósticos. Enquanto que o princípio da contrapartida dispõe que benefícios ou serviços não poderão ser criados, estendidos ou majorados sem a correspondente fonte de custeio.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (37, 'A Asssistência Social é a política social que provê as necessidades básicas e tem como diretrizes: a centralização político-administrativa e a participação dos governos estaduais, municipais e da união na formulação e controle das ações em todos os níveis.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (38, 'As contribuições sociais das empresas poderão ter alíquotas ou bases de cálculo diferenciadas, em razão da atividade econômica, da utilização intensiva de mão-deobra, do porte da empresa ou da condição estrutural do mercado de trabalho.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (39, 'Determinada lei ordinária previdenciária foi promulgada em 2015, contudo alguns artigos estão em conflito com lei ordinária anterior, os quais não foram revogados pela nova lei. Diante do conflito de normas de mesma hierarquia e mesma especialidade deve-se resolvê-lo por meio da aplicação da ordem cronológica, ou seja, os artigos de lei em conflito da norma atual prevalecem sobre os artigos da lei mais antiga.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (40, 'João, ocupante de cargo em comissão no INSS, não possui vínculo efetivo com a União, Autarquias, inclusive em regime especial, e Fundações Públicas Federais. Neste caso, por não contribuir para o Regime Próprio da Previdência Social, João deve contribuir para o Regime Geral da Previdência Social como contribuinte individual.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (41, 'Os Segurados do Regime Geral da Previdência Social divide-se em obrigatórios e facultativo, os obrigatórios são somente: empregado, empregado doméstico, contribuinte individual e trabalhador avulso.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (42, 'O Associado eleito para cargo de direção em Cooperativa e que recebe remuneração é segurado obrigatório do Regime Geral da Previdência Social e deve contribuir como contribuinte individual.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (43, 'Descaracteriza a condição de segurado especial, quando o segurado forma contrato de meação de até 50% de imóvel rural cuja área total não seja superior a 4 (quatro) módulos fiscais, desde que outorgante e outorgado continuem a exercer a respectiva atividade, individualmente ou em regime de economia familiar.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (44, 'Maria trabalha como empregada doméstica, dois dias por semana, na casa de Fernando. Diante disso, Maria deve contribuir para o RGPS como empregada doméstica.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (45, 'Fabiana, empregadora doméstica, deve contribuir para a Previdência Social no percentual de 8% sobre o salário de contribuição do empregado doméstico e 0,8% para o financiamento do seguro contra acidentes de trabalho, além de ser obrigada a repassar para a Previdência Social o valor devido pelo empregado.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (46, 'Os valores recebidos em decorrência da cessão de direitos autorais integram o salário de contribuição para as finalidades da Lei 8.212/91.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (47, 'O fisioterapeuta que presta serviço, em caráter eventual,  a mais de uma empresa e sem relação de emprego é considerado contribuinte individual para o Regime Geral da Previdência Social.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (48, 'A ausência de dependentes de primeira classe, possibilita aos pais em receber a pensão por morte de seu filho, tendo como requisito apenas a inexistência de dependentes da classe superior.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (49, 'Conforme estabelece a lei 8.213/91, julgue: João, apesar de enteado de Francisco, é equiparado a filho, pois foi assim declarado por Francisco e depende economicamente dele, além de contar com apenas 18 anos.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (50, 'O segurado facultativo tem como salário de contribuição o valor por ele escolhido, desde que respeite o salário mínimo nacional e o teto fixado em portaria pelo INSS. A alíquota máxima por ele recolhido será de 20% sobre o salário de contribuição.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (51, 'Com base no Decreto 6.214/07, julgue: o benefício de prestação continuada, conhecido também como LOAS, garante um salário mínimo mensal à pessoa com deficiência e ao idoso, com idade mínima de 60 anos ou mais, que comprovem não possuir meios para prover a própria manutenção e nem de tê-la provida por sua família.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (52, 'Ainda com base no Decreto 6.214/07, julgue: para o LOAS, considera-se que a família não é capaz de prover a manutenção do idoso ou do deficiente quando a renda mensal bruta familiar dividida pelo número de seus integrantes seja inferior a um quarto do salário mínimo. Além disso, os integrantes da família devem viver sob o mesmo teto.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (53, 'Sobre o salário de contribuição para a previdência social, julgue: a participação nos lucros ou resultados da empresa, quando paga ou creditada de acordo com lei específica e o valor correspondente a vestuários, equipamentos e outros acessórios fornecidos ao empregado e utilizados no local do trabalho para prestação dos respectivos serviços, são casos em que não integram o salário de contribuição para fins previdenciários.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (54, 'As empresas são obrigadas a pagar o percentual de 1%, 2% ou 4%, dependendo da gravidade preponderante da atividade, sobre a remuneração dos empregados ou avulsos para o SAT (Seguro do Acidente do Trabalho), que serve para custear benefícios por incapacidade.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (55, 'Constitui também receita para o INSS a contribuição sobre a receita de concursos de prognósticos, os quais são considerados todos e quaisquer concursos de sorteios de números, loterias, apostas, inclusive as realizadas em reuniões hípicas, nos âmbitos federal, estadual, do Distrito Federal e municipal.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (56, 'O INSS tem o prazo decadencial de 10 anos, antes de lançamento do tributo, para cobrar o valor da contribuição previdenciária. Enquanto que o beneficiário tem o prazo prescricional de 5 anos para reaver prestações vencidas ou quaisquer restituições ou diferenças devidas pela Previdência Social.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (57, 'O fato gerador para requerer o benefício do auxílio-doença é ficar incapacitado para o trabalho por mais de 30 dias consecutivos, pois os primeiros 30 dias competem à empresa em arcar com o salário do segurado.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (58, 'O auxílio-reclusão, destinado aos dependentes do segurado, tem como fato gerador o recolhimento do segurado em regime fechado ou semiaberto. Além disso, para que os dependentes possam receber o valor, o segurado, obrigatoriamente, deve ser considerado de baixa renda e receber até o valor estabelecido pelo INSS para tal categoria.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (59, 'Eduarda, segurada facultativa do Regime Geral da Previdência Social, requereu ao INSS o benefício do salário maternidade, em virtude de faltar apenas dois meses para o nascimento de seu filho. O INSS negou o pedido alegando que Eduarda conta apenas com 2 contribuições e com isso falta o período de carência necessário para ter direito ao benefício. Agiu corretamente o INSS.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (60, 'O salário de benefício para a aposentadoria de invalidez consiste na média aritmética simples dos maiores salários-de-contribuição correspondentes a oitenta por cento de todo o período contributivo, multiplicada pelo fator previdenciário', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (61, 'Augusto pretende se aposentar por tempo de contribuição, diante disso compareceu ao INSS informando que possui 35 anos de contribuição e 61 anos de idade. Diante disso, o INSS deferiu o pedido, pois o segurado se encaixa na regra 85/95 instituída em 2015, sem a necessidade de utilizar o fator previdenciário.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (62, 'O fator previdenciário é obrigatório na aposentadoria por tempo de contribuição, desde que não seja utilizada a regra 85/95. A ideia principal do fator previdenciário é atribuir um número de multiplicação ao salário de benefício, tendo como base de cálculo apenas a idade e o tempo de contribuição.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (63, 'A regra 85/95, estabelecida em 2015, possui uma tabela de progressão, sendo que em março de 2023 a regra passa a ser de 89/99.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (64, 'Se a incapacidade do segurado estiver relacionada com a progressão da doença pré-existente, ele terá direito ao benefício do auxílio-doença, o que não ocorre se a própria lesão pré-existente for invocada para garantir o benefício.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (65, 'João afastou-se do trabalho devido a um acidente de trânsito, após os 15 primeiros dias João foi encaminhado para o INSS para dar entrada no auxílio-doença, contudo, o segurado deixou de comparecer a agência naquele momento, o que fez somente após 45 dias de seu afastamento, diante disso João terá direito de receber o benefício apenas da data do requerimento em diante.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (66, 'O salário-família destina-se ao segurado empregado, empregado doméstico e ao avulso que possui filhos ou equiparados menores de 12 anos ou inválido de qualquer idade, desde que seja de baixa renda, conforme normas do INSS. O segurado recebe um valor pré-fixado pelo INSS por cada filho que estiver nas condições já mencionadas.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (67, 'O aposentado por idade ou por invalidez tem direito de continuar a receber o benefício de salário-família, desde que atendidos os requisitos estabelecidos em lei para os empregados na ativa.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (68, 'O salário-maternidade é devido ao segurado adotante pelo período de 120 meses, o qual será pago diretamente pela Previdência Social. No caso de falecimento do segurado adotante, o benefício será pago, por todo o período ou pelo tempo restante a que teria direito, ao cônjuge ou companheiro sobrevivente que tenha a qualidade de segurado, salvo no caso do falecimento do filho ou de seu abandono.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (69, 'A renda mensal do benefício, no caso do salário-maternidade para empregado ou avulso, poderá ser superior ao teto do INSS, pois corresponde a sua última remuneração. O que já não ocorre com o segurado especial, pois a renda mensal do benefício corresponde a um salário mínimo.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (70, 'Francisca, 35 anos, compareceu ao INSS para requerer a pensão por morte, uma vez que seu marido faleceu por causa de uma parada cardíaca. Após a análise dos papeis, constatou-se que Francisca estava casada apenas há 1 ano, antes do óbito do segurado, razão pela qual foi deferido a pensão por morte por apenas 15 anos. Agiu corretamente o INSS, pois considerou também a idade da dependente.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (71, 'A pensão por morte é dividida em cotas iguais aos dependentes, salvo quando o cônjuge sobrevivente concorrer com os filhos, neste caso o cônjuge sobrevivente recebe a metade do valor e a outra metade restante é dividida entre os filhos.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (72, 'João, 45 anos, acabou de perder a sua esposa, após um acidente de trânsito. Ela trabalhou por mais de 25 anos na mesma empresa e sempre contribuiu para o RGPS. João decidiu dar entrada na pensão por morte, juntando todos os documentos necessários, entre eles a certidão de casamento demonstrando que estavam juntos há mais de 5 anos. Diante disso, o INSS deferiu o pedido, sendo que a pensão será vitalícia, por causa dos elementos do caso concreto.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (73, 'Com as novas regras estabelecidas em 2015 a pensão por morte deixou de ser vitalícia, e, atualmente, a análise é feita em cada caso concreto, analisando os seguintes requisitos: a quantidade de contribuição do segurado, o tempo da união com o cônjuge sobrevivente e a idade deste.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (74, 'A pensão por morte e o auxílio-reclusão são benefícios destinados aos dependentes dos segurados do RGPS, sendo que a pensão por morte não possui carência e o auxílio-reclusão há carência mínima de 6 meses.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (75, 'A segurada facultativa que deseja receber o salário maternidade deve prestar atenção ao período de carência de 10 meses, o que poderá ser menor no caso de parto antecipado, desde que respeite a legislação vigente.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (76, 'O segurado da Previdência Social que recebeu auxílio-doença, auxílio-acidente, salário-família ou aposentadoria terá direito ao abono anual, o qual será calculado, no que couber, da mesma forma que a Gratificação de Natal dos trabalhadores, tendo por base o valor da renda mensal do benefício do mês de dezembro de cada ano.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (77, 'João faleceu em 05.01.2016 e Isabel deixou para dar entrada na pensão por morte apenas 65 dias após o óbito, segundo a legislação vigente, ela terá direito a pensão por morte a partir da data do óbito, pois foi requerida dentro do prazo de 90 dias.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (78, 'O dependente que ocasionou de forma dolosa a morte do segurado não perde o direito a pensão por morte, mesmo após o trânsito em julgado da decisão, por tratar-se de direito adquirido vinculado ao dependente do segurado.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (79, 'A aposentadoria por invalidez, com carência de 180 meses, será devida ao segurado, que obrigatoriamente tenha recebido auxílio-doença, for considerado incapaz e insusceptível de reabilitação para o exercício de atividade que lhe garanta a subsistência.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (80, 'A carência para todas as aposentadorias do Regime Geral da Previdência Social é de 180 meses, contudo, para a aposentadoria por invalidez este tempo pode ser reduzido para 12 meses, no caso da invalidez ser gerada pelo acidente de trabalho.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (81, 'O segurado beneficiado pela aposentadoria por invalidez poderá receber além do teto estipulado pelo INSS, desde que ele necessite da assistência permanente de outra pessoa, então neste caso receberá um acréscimo de 30% sobre o valor da aposentadoria. Após a morte do segurado este acréscimo será cessado, impossibilitando a sua incorporação a pensão por morte.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (82, 'Joaquim, segurado facultativo, aposentou-se por invalidez, entretanto, após 4 anos de invalidez constatou-se que o segurado encontra-se, novamente, recuperado para exercer qualquer profissão. Diante disso, a sua aposentadoria foi cessada após 4 meses de constatado a sua recuperação.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (83, 'Determinado segurado recebia aposentadoria por invalidez, porém, após 7 anos verificou-se que estava parcialmente recuperado para o trabalho, por este motivo, segundo a legislação vigente, o segurado irá receber, ainda, a aposentadoria por 18 meses, diminuindo de forma gradual. No caso em que ele recebia R$ 1.000,00 de aposentadoria, permanecerá recebendo este valor por mais 6 meses, depois será reduzido para R$ 500,00 por mais 6 meses e, ao final, receberá a quantia de R$ 300,00 pelos últimos 6 meses.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (84, 'O trabalhador rural terá redução de 5 anos na aposentadoria por idade, assim o homem tem direito de se aposentar com 60 anos e a mulher com 55 anos, respeitando a carência mínima de 180 contribuições.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (85, 'Na aposentadoria por idade a renda mensal consistirá nos 70% do salário de benefício, mais 1% deste, por grupo de 12 meses, não podendo ultrapassar 100% do salário de benefício, acrescido, obrigatoriamente, do fator previdenciário.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (86, 'O salário de benefício para o auxílio doença não poderá exceder a média aritmética simples dos últimos 12 salários de contribuição, inclusive em caso de remuneração variável, ou, se não alcançado o número de 12, a média aritmética simples dos salários-de-contribuição existentes.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (87, 'O contribuinte individual que contribuir para o RGPS por apenas 11% do salário de contribuição não terá direito a aposentadoria por tempo de contribuição, o que não ocorre com o segurado facultativo.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (88, 'Maria, que possui 26 anos de contribuição como professora infantil e 54 anos de idade, decidiu se aposentar. O pedido foi indeferido pelo INSS, pois Maria, como professora infantil, tem redução de 5 anos para aposentadoria por idade, o que falta ainda um ano para completar. Agiu corretamente o INSS.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (89, 'O segurado que requerer a aposentadoria por tempo de contribuição, dentro de 90 dias do seu desligamento, terá direito ao valor a partir da data do desligamento do emprego, caso seja feito após esse prazo, o valor devido será da data do requerimento em diante.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (90, 'O salário-família do trabalhador avulso poderá ser recebido pelo sindicato da classe respectiva, que se incumbirá de elaborar as folhas correspondentes e de distribuí-lo, sendo que a cota do salário-família não será incorporada, para qualquer efeito, ao salário ou ao benefício.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (91, 'Para o empregado doméstico ter direito ao salário-família é necessário, além dos requisitos comum a todos os segurados que têm o mesmo direito, deverá, segundo a lei, apenas apresentar a certidão de nascimento do dependente menor de 14 anos.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (92, 'O carregador de bagagem em porto, por ser contribuinte individual, deverá contribuir com 20% sobre o valor do mínimo até o teto e terá direito a aposentadoria por tempo de contribuição, desde que preencha a carência mínima e tenha no mínimo 35 anos de contribuição.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (93, 'Fernando, deficiente que tem impedimentos por mais de 2 anos, pretende se aposentar, para tanto requereu ao INSS a aposentadoria por tempo de contribuição, tendo em vista que já possui 25 anos de tempo de contribuição, o mínimo necessário para a sua deficiência que é grave. O pedido foi deferido pelo INSS.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (94, 'Fernanda, que trabalha em condições nocivas à saúde de forma permanente por 25 anos, requereu ao INSS o benefício da aposentadoria especial, contudo, o pedido foi negado pelo INSS, por entender que, apesar dos agentes nocivos constatados no PPP (Perfil Profissiográfico Previdenciário), ela encontra-se em perfeitas condições de trabalho, motivo pelo qual descabe qualquer pedido de aposentadoria. Agiu corretamente o INSS.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (95, 'O segurado que trabalhar em condições nocivas à saúde por apenas um período poderá requerer a conversão desse tempo de atividade em tempo de atividade comum, conforme tabela estabelecida nas normas vigentes.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (96, 'Período de graça ocorre quando o segurado mantém está qualidade mesmo sem contribuir para a Previdência Social. Para o segurado detento/recluso o prazo é de 12 meses contados a partir de sua saída do estabelecimento prisional, além disso, ele terá a adição de 12 meses, caso já tenha mais de 120 contribuições. Assim, este segurado poderá alcançar 24 meses de período de graça.', 1, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (97, 'Eduardo, segurado facultativo do RGPS, contribuiu pela última vez à Previdência Social em 15.12.2015. Ele mantém a qualidade de segurado por 6 meses sem contribuir, diante disso, Eduardo deixou de ser segurado do RGPS em 16.06.2015.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (98, 'A perda da qualidade de segurado prejudica o direito à aposentadoria para cuja concessão tenham sido preenchidos todos os requisitos, segundo a legislação em vigor à época em que estes requisitos foram atendidos.   ', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (99, 'Patrícia contribiui durante 10 anos para o Regime Geral da Previdência Social, ocorre que hoje contribui para o Regime Próprio da Previdência Social, pois é técnica do INSS. Segundo a Lei 8.213/91, Patrícia não pode realizar a contagem reciproca com o período anterior, pois tratam-se de regimes diferentes e a lei veda este tipo de contagem.', 2, 1, 4);
INSERT INTO `question` (`question_id`, `question_description`, `correct_question_option_id`, `question_score_setting_id`, `question_difficult_id`) VALUES (100, 'O empregador que omiti da folha de pagamento da empresa informação previsto pela legislação previdenciária sobre trabalhador avulso que lhe preste serviço comete o crime, tipificado no código penal, de sonegação de contribuição previdenciária.', 1, 1, 4);
